window.bookSummaryJSON = "<p>I used to be a computer programmer...I think. </p> <p>But then I woke up in a strange new world as a...god? Part of me thinks this is some ultra-realistic VR game, but things just seem and feel too real. </p> <p>Especially the three beautiful priestesses, who have traveled from afar just to worship and love me. </p> <p>I don’t know what’s going on, but as their god, it is my job to protect them, and the only way to do that is to level up by teaching them how to survive and build in this brutal wilderness.</p>"; 
